<script>
  $(document).ready(function(){
    $('svg>a').mouseover(function(){
      $('#mapDiv').show();
      //alert($(this).children("text").text());
      var text = $(this).children("text").text();
      var left = $(this).children("text").attr('x') ;
      var top = $(this).children("text").attr('y');
      top =top - '85';
      left = left - '75';
     $('#mapDiv').css({"top":top+'px',"left":left+'px'});
      //$('#mapDiv').css({"top":'25px',"right":'25px'});
     //alert(text + ' - ' + top+ ' - ' +right);
     $('#mapName').text(text);
    });

    $('a').mouseleave(function(){
       $('#mapDiv').hide();
    });
  });
</script>






